        .on("mousemove", tooltip.onMouseMove)
        .on("mouseleave", tooltip.onMouseLeave)
        .on("click", (event, d) => {
          if (d === selectedNode) {
            updateChart();

            updateChart(d);

      const rect = nodeGroups
        .selectAll("rect")
        .data(d => [d])
        .join("rect")
        .attr("id", d => d.nodeUid.id)
        .attr("fill", d => color(d).backgroundColor)
        .attr("rx", 2)
        .attr("ry", 2)
        .attr("width", d => d.x1 - d.x0)
        .attr("height", d => d.y1 - d.y0)
        .style("stroke", null)
        .attr("stroke-width", null);

      if (selectedNode != null) {
        rect

        .selectAll("clipPath")
        .data(d => [d])
        .join("clipPath")
        .attr("id", d => d.clipUid.id)
        .selectAll("use")
        .data(d => [d])
        .join("use")
        .attr("xlink:href", d => d.nodeUid.href);

        .data(d => [d])

        .selectAll("tspan")

        .text(d => d);

      nodeGroups
        .filter(d => d.children)
        .selectAll("tspan")
        .attr("dx", 3)
        .attr("y", 13);

      nodeGroups
        .filter(d => !d.children)
        .selectAll("tspan")
        .attr("x", 3)
        .attr(
          "y",
          (d, i, nodes) => `${(i === nodes.length - 1) * 0.3 + 1.1 + i * 0.9}em`
        );

      tooltip.buildCache(nodeGroups, {
        getNodeSize: d => d.originalValue,
        totalSize: root.originalValue,
        nodes,
        links
      });
    };

    updateChart();
  };

  return drawChart;
